module.exports = a = async ({params}) => {

	var userInput  =  "";
	userInput = params.userInput;
	var authMethod = "";
	var smsVoice ;
	var email ;
	var isMoreDevices = "";
	var mailformat = /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/

	if(userInput.startsWith("sms:") || userInput.startsWith("voice:")){
		smsVoice = userInput.split(":");
		authMethod = smsVoice[0];
		smsVoice = smsVoice[1];
		isMoreDevices = "false";

	}
	else if (userInput.match(mailformat)){
		authMethod = "email"
		email = userInput
		isMoreDevices = "false";
	}
	else if (userInput.toLowerCase() == "more"){
		isMoreDevices = "true";
	}
	else if (userInput.toLowerCase() == "back"){
		isMoreDevices = "back";
	}



	return {'authMethod': authMethod.toUpperCase(), 'smsVoice' : smsVoice, 'email': email, 'isMoreDevices': isMoreDevices}
}

